import React from 'react';
import '../css/Login.css';
import logo from '../img/logo.png';
import { useNavigate } from 'react-router-dom';

function Login() {
  const navigate = useNavigate();

  const loginClick = () => {
    window.location.href = '../Main.js'
  };

    return (
      <div className="Login">
        <header className="Login-header">
            <form class="loginForm">
                <img src={logo} className="rentfyLogoLogin" alt="logo" />
                <h3>Faça Login</h3>

                <label for="username">Usuário</label>
                <input type="text" placeholder="Usuário" id="username" class="inputLogin"/>

                <label for="password">Senha</label>
                <input type="password" placeholder="Senha" id="password" class="inputLogin"/>

                <button onClick={loginClick}>Log In</button>
            </form>
        </header>
      </div>
    );
}

export default Login;
